  { id: 241, user_id: 1, title: %^Food-stuffs I'm mailing to myself in Antarctica^, description: %^I didn't take any special food or snacks to Antarctica last season. This time around I decided that I might enjoy myself just a little bit more if I have a few of my favorite food-things there with me. If you feel like sending me something yourself, here's the address: Eli Duke (RPSC), McMurdo Station, PSC 469 Box 700, APO AP 96599-1035. Oh yeah, and styrofoam is a banned substance in Antarctica. Just a heads up.^, public: true, ordered: false, created_at: "2008-09-26 03:14:08 UTC", updated_at: "2015-04-07 12:06:45 UTC" },
