  { id: 249, user_id: 2, title: %^Awesome Genius Playlist^, description: %^iTunes 8 added a feature called "Genius" where iTunes makes suggestions of songs to buy similar to what is playing or creates playlists (from songs in your library) based on some selected song. It does this by harnessing the collective intelligence of everyone else's listening habits who opts into the Genius feature. So, I selected "Back in Your Head" by Tegan & Sara off their most recent record "The Con" and this is the playlist that Genius made for me. Pretty dope.^, public: true, ordered: true, created_at: "2008-09-30 10:55:11 UTC", updated_at: "2014-10-05 13:11:01 UTC" },
  { id: 250, user_id: 2, title: %^I'm Selling My Comic Collection^, description: %^All of these are trade paperbacks / hardcover / graphic novels / collected editions. I trend toward the fancy version hardcovers when available. But not always. I obviously have some holes in some runs and some titles totally absent. This list will grow with time. (It's a numbered list instead of bullets, not for ordering, but just for the total count.) For posterity, i'm keeping this list in tact, even after I sell books. If it's been sold, I'll put *** before the title.^, public: true, ordered: true, created_at: "2008-10-18 16:42:19 UTC", updated_at: "2015-03-28 13:38:35 UTC" },
