  { id: 258, user_id: 3, title: %^Things that are noticeably better since becoming unemployed^, description: %^I have been unemployed for about 7 hours (right... now) and I have already noticed quite a few things that I have a much better attitude about. Each one of these things I have done and afterwards thought 'hey, I don't hate that anymore' or 'ahhh... now I remember why I used to do this'. Seems strange that a job could make somebody enjoy simple things less, but it sure does.^, public: true, ordered: false, created_at: "2008-10-06 18:49:14 UTC", updated_at: "2015-04-08 10:12:04 UTC" },
