  { id: 267, user_id: 1, title: %^Antarctic Acronyms, Abbrevs, & Lingo^, description: %^I've spent 3 summer seasons (Oct - Feb) working at McMurdo Station, Antarctica. From the second you arrive on station you are bombarded with ridiculous amounts of acronyms, abbreviations, and lingo. It's pretty overwhelming. This is a growing list, so please help me fill it out by leaving a comment if you there's something missing. Also keep in mind that the ALL CAPS items are pronounced by sounding-out each letter individually, accept when specified {inside curly brackets}.^, public: true, ordered: false, created_at: "2009-02-07 06:17:28 UTC", updated_at: "2015-04-06 17:05:57 UTC" },
