  { id: 408, user_id: 71, title: %^Alaskan Animals^, description: %^I moved to Alaska, Fox Island near Seward to be exact, on May 23rd. So far I've seen plenty of wild life. I'm keeping my fingers crossed to see more.^, public: true, ordered: false, created_at: "2010-05-27 23:50:54 UTC", updated_at: "2015-04-08 06:58:32 UTC" },
  { id: 409, user_id: 71, title: %^What Will Steve Say Next?^, description: %^I just started working on a remote island in Alaska. It's small, about an hour by boat from town. besides a few overnight guests there are only about 15 of us out there. No roads, just us and a few animals. Steve is this crazy kook that works with us. At first he was sorta annoying, nice enough, but annoying. Then I thought if I made a list of one CRAZY thing he said a day, it might just be hilarious. So keep checking back, this might just last all summer.^, public: true, ordered: true, created_at: "2010-05-29 21:09:13 UTC", updated_at: "2015-04-08 10:25:41 UTC" },
