  { id: 1206, list_id: 122, body: %^His obsession with his true love-computers. His lab top goes with him everywhere! To parties, grocery shopping, wherever he is.. that "thing" goes.^, position: 1 },
  { id: 1207, list_id: 122, body: %^He is in love with buying computers and selling them. I swear his butt shakes out of excitement when we drive by a beat up computer in the dumpster.^, position: 2 },
  { id: 1208, list_id: 122, body: %^Im pretty sure he once kissed his computer to make me jealous.^, position: 3 },
  { id: 1209, list_id: 122, body: %^There is constantly a rhythm or song in his head. So much that hes always tapping, or clicking to a beat.^, position: 4 },
  { id: 1210, list_id: 122, body: %^Sometimes even in the middle of the night his head goes up and down repeatedly. Hes done it since he was a baby, the fam calles it bonky bonk(?).^, position: 5 },
  { id: 1211, list_id: 122, body: %^He calls me a jerk about 10 thousand times a day.^, position: 6 },
  { id: 1212, list_id: 122, body: %^He made up a website about how ridiculous I am, then wrote a list about the same subject matter.^, position: 7 },
  { id: 1213, list_id: 122, body: %^His obsession with poop. Poop jokes, poop sounds, poop looks.. his poop, other peoples poop. I wont even get into his art poop idea.^, position: 8 },
  { id: 1214, list_id: 122, body: %^All his get rich quick ideas....^, position: 9 },
  { id: 1215, list_id: 122, body: %^His "yeah yeah just a second" s. Eli time is about 3o minutes to an hour after everyone elses.^, position: 10 },
  { id: 1216, list_id: 122, body: %^Hes a lingerer. Never is the first one to leave.^, position: 11 },
  { id: 1217, list_id: 122, body: %^If I didnt complain hed be up till 5-6 am making out with his computer(pooter).^, position: 12 },
  { id: 1218, list_id: 122, body: %^His dislike for dogs, yeah, hes the guy that puts his hands up in the air or puts his knee into a dogs chest when its just trying to give you some lovins!^, position: 13 },
  { id: 1219, list_id: 122, body: %^The REASONS he loves a cat. I can love cats, but our reasons are polar opposites. He loves the independence, the moodiness, the self sufficiency, the tinyness, and the non mess. L-A-M-E.^, position: 14 },
  { id: 1220, list_id: 122, body: %^His lack of needing people. He can go weeks/months without talking to the parents.^, position: 15 },
  { id: 1221, list_id: 122, body: %^His dislike for any day requiring gifts to be given. Doesnt even send a birhthday card!^, position: 16 },
  { id: 1222, list_id: 122, body: %^Hes squeemish about anyting remotely cliche (in his mind). Saying I miss you on the phone, traveling to certain touristy/hip areas are too cliche as well.^, position: 17 },
  { id: 1223, list_id: 122, body: %^Finally, hes in love with me. Honestly, who can stand my freakishness..we all know im eli times 10 but in the opposite way times 10.^, position: 18 },
  { id: 1224, list_id: 123, body: %^His honesty. Although sometimes maybe too honest, theres no one else I trust more than him. Ive never felt so secure in a relationship.^, position: 1 },
  { id: 1225, list_id: 123, body: %^The kindest heart. As "cliche" as it sounds, if youre hurting, he hurts. He absolutly hates to see anyone in pain. He will try and try to solve problems and help. He has the biggest heart and such a compassionate nature.^, position: 2 },
  { id: 1226, list_id: 123, body: %^Hes as liberal as they come baby! Eco villages, greywater, sustainability, nater lovin, rebellious natured Eli. Hes just how i like em.. liberal and hairy.^, position: 3 },
  { id: 1227, list_id: 123, body: %^His forever questioning. Hes always researching and asking questions. He has a love for opinions, and he asks questions to get them. (if he wants to have a good opinion)^, position: 4 },
  { id: 1228, list_id: 123, body: %^His rebellious side. He once called some sororiety, big sun glasses, and big haired ..bitch, a "piece of shit" to her face when she was clearly being a piece of shit. Eli will argue to death with anyone no matter how high the authority figure is.^, position: 5 },
  { id: 1229, list_id: 123, body: %^His confidence. His rebellious side and honesty comes from such a strong self confidence.^, position: 6 },
  { id: 1230, list_id: 123, body: %^Although a nerd, he has an artsy side. I have one of his paintings on my, I mean "our" wall in our bedroom. Hes creative and incredibly detail oriented about art.^, position: 7 },
  { id: 1231, list_id: 123, body: %^Cmmon, the guys a looker. In college he was a substitue teacher for highschoolers and girls would literally scream and whisper when hed enter a room.^, position: 8 },
  { id: 1232, list_id: 123, body: %^Almost always patient. Hes put up with me for over two years now, THAT takes patience.^, position: 9 },
  { id: 1233, list_id: 123, body: %^His feminine side. Yes you can have too much man in your life. Hes a great balance.^, position: 10 },
  { id: 1234, list_id: 123, body: %^His love for teaching. Constantly trying to expand my mind, teaching me about politics and the every day how tos.^, position: 11 },
  { id: 1235, list_id: 123, body: %^His family. I joke about not being able to brake up with him for fear id lose the other dukes. Nate who i joke about having a crush on, Hannah who i jokingly call my sister in law, are all jokes,or are they. If I were a duke itd totally kick ass^, position: 12 },
  { id: 1236, list_id: 123, body: %^These are the reaons i love Eli Duke, there are probably 10 kagillon more, but I refuse to become any more mooshier than I already have.^, position: 13 },
