  { id: 3819, list_id: 323, body: %^because smoking has always been my (bad) friend when shit was tough.^, position: 1 },
  { id: 3820, list_id: 323, body: %^I like the smell of a fresh pack.^, position: 1 },
  { id: 3821, list_id: 323, body: %^it enables me to romanicize appalachia. ^, position: 1 },
  { id: 3822, list_id: 323, body: %^(I pretend) it relaxes me when I'm stressed.^, position: 1 },
  { id: 3823, list_id: 323, body: %^it makes me feel like a champ to say, "I ran 5 miles and I'm a smoker!"^, position: 1 },
  { id: 3824, list_id: 323, body: %^it's an excuse to go outside.^, position: 1 },
  { id: 3825, list_id: 323, body: %^it's a reward (I know how dumb that sounds).^, position: 1 },
  { id: 3826, list_id: 323, body: %^rolling cigarettes is peaceful and artful.^, position: 1 },
  { id: 3827, list_id: 323, body: %^among people who smoke, there is great camaraderie.^, position: 1 },
  { id: 3828, list_id: 323, body: %^I am rebelling. still.^, position: 1 },
  { id: 3829, list_id: 323, body: %^smoking makes me remember Devlin.^, position: 1 },
  { id: 3830, list_id: 323, body: %^my mother smokes. it's nice to do it with her.^, position: 1 },
  { id: 3831, list_id: 323, body: %^I'm self important and smoking give me an extra "need" and sense of urgency.^, position: 1 },
  { id: 3832, list_id: 323, body: %^smoking is great company while waiting for a train.^, position: 1 },
  { id: 3833, list_id: 323, body: %^stillness^, position: 1 },
  { id: 3834, list_id: 323, body: %^I measure time (the walk to school, the bus transfer) based on how long it takes me to smoke a cigarette.^, position: 1 },
  { id: 3835, list_id: 323, body: %^when I was attacked when I was 16, I put my cigarette out on the guy's arm. I believe it saved me.^, position: 1 },
