  { id: 5958, list_id: 396, body: %^i learn a lesson with every episode. it really makes me feel like i'm becoming a better person.^, position: 1 },
  { id: 5959, list_id: 396, body: %^sometimes i feel like i could be a part of the family. i mean, i know they would accept me for who i am.^, position: 1 },
  { id: 5960, list_id: 396, body: %^i actually laugh out loud. ^, position: 1 },
  { id: 5961, list_id: 396, body: %^i get to look at Uncle Jesse. hottie hott hot.^, position: 1 },
  { id: 5962, list_id: 396, body: %^i can relate real life to episodes of Full House all the time. if you hang out with me, you've certainly heard me say, "thats like this one time on Full House when..."^, position: 1 },
  { id: 5963, list_id: 396, body: %^there are some episodes that i just can't really watch anymore because they are embarrassing and stupid... but that doesn't make me love it any less.^, position: 1 },
  { id: 5964, list_id: 396, body: %^if i'm ever sad, i can put on an ep and it always makes me feel better. ^, position: 1 },
  { id: 5965, list_id: 396, body: %^i have like 3 friends that i can watch it with... everyone else just makes fun of me.^, position: 1 },
  { id: 5966, list_id: 396, body: %^and well... so many more reasons. but i don't want to bore you.^, position: 1 },
