  { id: 6289, list_id: 409, body: %^May 26- Steve told me a 45 min long story about condiments at Yellowstone, where he worked last summer. I tried to walk away, but he kept talking until after I was out the door, and the door had closed.^, position: 2 },
  { id: 6290, list_id: 409, body: %^May 28- I was telling a co-worker about stars and auroras during August in Antarctica, Steve told me next time I should just take 3 hits of acid, then I wouldn't have to travel so far.^, position: 4 },
  { id: 6291, list_id: 409, body: %^May 27- I mostly realized how many guttural noises and burps and farts he lets out. Oh, there's also the talking to himself. Side note, he used one of the girl's towels after his shower (after I gave him his very own clean towel) she was PISSED.^, position: 3 },
