  { id: 161, user_id: 1, list_id: 64, body: %^oh rosa, you are so funny sometimes. actually, "dumpstered" is not used often in the world. a more common term is "dumpster diving," which is basically what you said (rubbish bin? that is hilarious). the idea is simple: people throw away a lot of things that aren't really trash. sometimes it is stuff that is only slightly broken, and sometimes it is stuff that people just don't want anymore and don't really care about. dumpster diving is especially rewarding near college campuses because students are notorious for throwing away perfectly good things. we "hit" (which basically means "we went to") all the dormitory dumpsters as well as a juice dumpster down town. there's a great wikipedia entry here: http://en.wikipedia.org/wiki/Dumpster_diving^, created_at: "2006-06-08 16:34:14 UTC" },
  { id: 162, user_id: 23, list_id: 64, body: %^oh i see. i think its called "skipping" in the UK. So are you freegans then? I remember once we went to a building site skip and got those wooden things that go under boxes and whatnot and used them as a bed stand. And we once took some bricks for the hamster to play with never taken food or juice(!) though. JUICE dumpster?!?! is a huge rubbish bin (yes, i'm british) filled with orange juice or something? does it have a tap on the side so you can get it out? ooh er. all sounds a bit dodgy if you ask me.^, created_at: "2006-06-09 00:51:57 UTC" },
  { id: 163, user_id: 1, list_id: 65, body: %^you know what they say... if i can't be fixed with duct tape, it's not worth fixing at all. but i'd have to say that you forgot one: removing lint from your clothes.^, created_at: "2006-06-09 01:50:52 UTC" },
  { id: 164, user_id: 1, list_id: 64, body: %^seriously, rosa, i'm laughing out loud over here. all your "britishisms" are cracking me up. hilarious! but seriously, a juice dumpster is NOT a giant dumpster filled with juice and a tap on the side. it is a dumpster filled with juice containers: half gallon and 12 ounce sizes to be exact. and those wooden things you spoke of, those are called pallets. you can also find relatively fresh produce (fruits and veggies) as well. oh, and we aren't freegans, we are vegans. we will however get whatever free food we can find and then just give it away to non-vegan friends of ours.^, created_at: "2006-06-09 01:52:31 UTC" },
