  { id: 311, user_id: 1, list_id: 120, body: %^i'm trying to learn more spanish and i'm going to a weekly spanish speaking night. so i'm going to try and translate this without any help, which basically means not using any online translator. here goes: reasons why i made this list - because i don't have to go to the "maleta" - i wanted to make a list in castellano - i was bored booyah! the only thing i don't know is "maleta." but i'm curious, what is the difference between spanish and castellano? on a different note, way to go rosa! it makes me think of the possibilities of having ListYourList in different languages.^, created_at: "2006-06-26 04:13:26 UTC" },
  { id: 312, user_id: 25, list_id: 120, body: %^maleta = suitcase, hacer la maleta is pack your suitcase. Rosa can explain/correct me but here's my explanation of Castillian vs. Spanish Spain wasn't always "Spain" but several different kingdoms. Ferdinand was the king of Castille and married Isabella queen of Leon. This led to a strong central leadership and power for the "reconquest" of Spain against the Moors. Spain as we know it know came from this marraige. Wikipedia says this: "Spaniards tend to call the language español (Spanish) when contrasting it to languages of other states, such as in a list with French (francés), English (inglés), German (alemán), Chinese (chino), and so on. Castellano (Castilian) by contrast, is more often used when contrasting the language with other regional languages of Spain: Aragonese, Asturian, Basque, Catalan, Extremaduran, Galician, and so on. In this manner, the Spanish Constitution of 1978 uses the term castellano to define the official language of the whole State, opposed to las demás lenguas españolas" Now, because of Francisco Franco's rule that only Castillian be used during his reign, some Spaniards are very proud of their regional languages (such as Catalan, Galician, Basque etc.) and might take offense that castellano = spanish. Outside of Spain (i.e. Latin America, USA) most people don't give a fart and call it Spanish. This reply was much longer than I had first intended.^, created_at: "2006-06-26 07:37:15 UTC" },
