  { id: 326, user_id: 23, list_id: 120, body: %^Pat is completely correct (almost). I live in the "comunidad valenciana" where there are 2 official languages: castellano and valenciano, which is basically catalan, but dont say that out loud or they will kill you. I suppose i just got used to saying "castellano" when i'm talking in spanish. for example, i didnt have spanish lessons, i had "lengua castellana" lessons. pat did make a tiny mistake! Ferdinand was king of Aragon (not Castille), and Isabelle was queen of Castille (not Leon). Wow, for the first time in my life i have seen benefits to the "ciencias sociales" (history and geography) lessons which were basically composed of learning a text book off by heart.^, created_at: "2006-06-27 04:53:37 UTC" },
