  { id: 409, user_id: 23, list_id: 146, body: %^hahahaha. we don't have english/spanish accents. we have south london accents. for example i use "brang" instead of "brought" and i say "ain't" a lot and i pronounce 'a's like "arr" so class is "clarrss" instead of "class (northen accent)". oh yeah and im probably taller than you (5'11") and i still have like 6 months to grow. so there. but we are still cute :D. we made up words like "dooby" which is why my friends call me dooby. and we call the tv remote control "clinger". and when i argue with ivan we use spanglish as its much more effective.^, created_at: "2006-07-24 13:59:50 UTC" },
