  { id: 625, user_id: 2, list_id: 320, body: %^The first time I met Scott, Bookis and Gary was in Portland for the Zine Symposium in 2004 (maybe 2003?). Later that day, Scott, Gary and I were Zoobombing on kids mini bikes that had been built minutes before. Dark. Curvy. Downhill. No helmet. Bald tires. Wobbly back wheel. Coaster brakes. Scary. As. Shit. But at least I was sober, unlike most of the riders.^, created_at: "2009-01-14 14:32:15 UTC" },
