  { id: 649, user_id: 71, list_id: 371, body: %^Cedar, Let me tell you about the Warped Tour... I was NOT excited about going at first, I mean, all day festival in the hot sun, ground covered in half eaten turkey legs with a group of people who are for the most part UNDER 18 years old... Wasn't sounding to tempting. BUT Eli talked me into it and it ended up being totally worth it (Thanks Eli). The best part was we snuck in. But we ended up having a really great time and an even better adventure. Out of the 60 bands playing, I had heard of, HEARD OF (like didn't know them well) 7 of them. AND then one of the bands covered NOFX and hardly anyone knew who they (NOFX) were. What is the world coming to? All in all, unforgettable! Thanks for asking.^, created_at: "2009-08-20 19:38:06 UTC" },
